import React from 'react';

const Button = ({ onClick, label, type = "button" }) => {
  return (
    <button
      onClick={onClick}
      type={type}
      className="px-4 py-2 bg-indigo-700 text-white rounded hover:bg-indigo-800 transition" // Updated background color to match your intent
      aria-label={label}
    >
      {label}
    </button>
  );
};

export default Button;
